const PageNotFound = () => {
  return (
    <main className='container'>
      <div className='row justify-content-center mt-3 mb-3'>
        <div className='col-8'>
          <h1 className='text-danger fs-1'>404 - Page Not Found</h1>
        </div>
      </div>
    </main>
  )
}

export default PageNotFound
